import { List, ListItemButton, ListItemIcon, ListItemText, Table, TableBody, TableCell, TableContainer, TableHead, TableRow } from "@mui/material";

import { Colors } from '../../styles/theme';
import RemoveIcon from '@mui/icons-material/Remove';
import AddIcon from '@mui/icons-material/Add';

export default function CartTable (){
    return(
        <TableContainer >
            <Table>
            <TableHead>
                <TableRow>
                    <TableCell>Item</TableCell>
                    <TableCell>Price</TableCell>
                    <TableCell>Count</TableCell>
                    <TableCell>Total</TableCell>
                </TableRow>
            </TableHead>
            <TableBody>
                <TableRow>
                    <TableCell>Item 1</TableCell>
                    <TableCell>2.90</TableCell>
                    <TableCell>
            <List sx={{
                display:"flex",
                alignItems:"center",
                width:"50%",
                background:Colors.light_gray,
                padding:"0",
                marginTop:"10px"

            }}>
                <ListItemButton   sx={{
                    background:Colors.white,
                    justifyContent:"center",
                    width:"40px",
                    marginLeft:"4px",
                }}>
                    <ListItemIcon  sx={{
                    background:Colors.white,
                    justifyContent:"center"
                }}><RemoveIcon/></ListItemIcon>
                </ListItemButton>
                <ListItemButton >
                    <ListItemText sx={{
                        textAlign:"center"
                    }}>Count</ListItemText>
                    </ListItemButton>
                <ListItemButton  sx={{
                    background:Colors.white,
                    justifyContent:"center",
                    width:"40px",
                    marginRight:"4px",
                }} > <ListItemIcon  sx={{
                    background:Colors.white,
                    justifyContent:"center"
                }}><AddIcon/></ListItemIcon></ListItemButton>

            </List></TableCell>
                    <TableCell>49.0</TableCell></TableRow>
            </TableBody>
            </Table>
        </TableContainer>
    )
}
